import React from 'react';

const Multipleinput = () => {
  return <>
      <form action=''>
          <div>
              <label htmlFor='username'>Name</label>
              <input type='text' name='username' id='usename'/>
          </div>
      </form>
  </>;
};

export default Multipleinput;
